import React from 'react';

const ViewProfile: React.FC = () => {
  return (
    <div className="bg-white rounded-2xl shadow-lg p-4 h-[150px] w-[120px] flex flex-col items-center justify-center mx-auto md:ml-auto">
      <div className="w-10 h-10 rounded-full bg-gray-800 flex items-center justify-center mb-3">
        <span className="text-white text-sm">P</span>
      </div>
      <button className="bg-emerald-600 text-white px-3 py-1 rounded text-xs hover:bg-emerald-700 transition-colors whitespace-nowrap">
        View Profile
      </button>
    </div>
  );
};

export default ViewProfile;
